import Footer from './Components/Footer';
import Header from './Components/Header';
import Main from './Components/Main';
import { Container, Row } from 'react-bootstrap'

function App() {
  return (
    <div className='Main'>
      <Container fluid="md">
        <Row>
          <Header />
        </Row>
        <Row>
          <br/>
          <br/>
          <Main />
        </Row>
        <Row>
          <Footer />
        </Row>
      </Container>
    </div>
  );
}

export default App;
